Dog Pound (2010)  

Frankrijk
Drama

geregisseerd door Kim Chapiron
met Adam Butcher, Shane Kippel en Mateo Morales

De drie jonge wetsovertreders Carlin, Angel en Davis arriveren in de jeugdgevangenis Maplewood, onder het toeziend oog van Goodyear, een strenge maar meelevende bewaker. Carlin, overgeplaatst uit een andere instelling voor mishandeling, wacht zijn tijd af tot hij naar een normale gevangenis wordt gestuurd. Hij en Davis worden al vrij snel het slachtoffer van Banks, de meest gevreesde jongen van het instituut. Beiden willen niets over de gebeurtenis kwijt, en belanden daarom in de isoleercel. Eenmaal terug verslaat Carlin Banks en claimt de positie van &quot;Top Dog&quot;.

